import React from 'react';

const BotArmy = ({ enlistedBots, releaseBot }) => {
  return (
    <div>
      <h2>Your Bot Army</h2>
      {enlistedBots.map((bot) => (
        <div key={bot.id}>
          <img src={bot.avatar_url} alt={bot.name} />
          <h3>{bot.name}</h3>
          <button onClick={() => releaseBot(bot.id)}>Release</button>
        </div>
      ))}
    </div>
  );
};

export default BotArmy;
